import React from "react";
import { PURPLE_GRADIENT } from "./theme";

export const GCUAppBar = () => {
  return (
    <div
      style={{
        position: "sticky",
        top: 0,
        left: 0,
        width: "100vw",
        height: "56px",
        background: PURPLE_GRADIENT,
      }}
    >
      <div style={{ fontWeight: "bold", textAlign: "center" }}>Student ID</div>
    </div>
  );
};
